nta.declaration:
// Place global declarations here.


clock t;
clock d; 

double d_e = 0.04;
double t_e = 0.04;
double cost = 0.0;
double PENALTY = 100.0;

// actions
const int N = 2;
typedef int[0,N-1] action_t;
const action_t SLOW = 0;
const action_t FAST = 1;

// effects of actions
double d_delta[N] = {0.1, 0.17};
double t_delta[N] = {0.12,0.05};
double act_cost[N] = {1.0, 3.0};

// Shield stuff

import "/home/andreashhp/Documents/university/direc/stratetrees/experiments/automated/random_walk/shields/shield.so" {
    int shield(double t, double x);
};

// allowed actions
const int NOTHING = 0;
const int ONLY_FAST = 1;
const int ALL = 2;

int interventions = 0;
int danger = 0;

bool shield_enabled = true;
bool unlucky = false;

void update(action_t act) {
    if (unlucky) {
        d = d + d_delta[act] - d_e;
        t = t + t_delta[act] + t_e;
    } else {
        d = d + d_delta[act] - d_e + random(d_e * 2);
        t = t + t_delta[act] - t_e + random(t_e * 2);
    }
    cost = cost + act_cost[act];
}

/* the only action that is enforced is FAST */
bool allowed(action_t act) {
    if (!shield_enabled) { return true; }
    if (shield(t, d) == ONLY_FAST) { return act == FAST; }
    else { return true; }
}

/* intervene based on shield. only used for post-shielding */
action_t intervene(action_t act) {
    if (!shield_enabled) { return act; }
    else {
        int allowed_actions = shield(t, d);

        // no action allowed, return suggested action
        if (allowed_actions == NOTHING) {
            danger++;
            return act;
        }
        // enforce going fast
        else if (allowed_actions == ONLY_FAST) {
            if (act != 1) { interventions++; }
            return 1;
        }
        // anything goes!  (allowed_actions == ALL)
        else {
            return act;
        }
    }
}

nta.system:
// Place template instantiations here.
P = PreShielded();
// List one or more processes to be composed into a system.
system P;
